import "../styles/globals.css";
import "bootstrap/dist/css/bootstrap.css";
import Layout from "../components/layout";

class MyApp extends React.Component({ Component, pageProps }) {
  render() {
    return (
      <Layout className="layout">
        <Component {...pageProps} />
      </Layout>
    );
  }
}

export default MyApp;
